	"com/swcc/Template/fragments/Comment.fragment.xml":'<core:FragmentDefinition xmlns="sap.suite.ui.commons" xmlns:core="sap.ui.core" xmlns:mvc="sap.ui.core.mvc" xmlns:m="sap.m"\n\txmlns:l="sap.ui.layout"><l:VerticalLayout class="sapUiContentPadding" width="100%"><l:content><Timeline id="idTimeline" enableDoubleSided="true" groupByType="Year" groupBy="" textHeight="4" sortOldestFirst="true" showFilterBar="false"\n\t\t\t\tclass="ssp-comment"><content><TimelineItem userName="Laurent Dubois" select="onPressItems" title="Accounts Payables Manager" userPicture="/images/Laurent_Dubois.png"\n\t\t\t\t\t\ticon="sap-icon://person-placeholder" filterValue="Accounts Payables Manager"\n\t\t\t\t\t\ttext="Plans, organizes and manages the operations and activities of an accounts payables.&#xA;Supervises employees and monitors activities.&#xA;Final check of accounts payable payments and sign off.&#xA;Reporting to the head of finance.&#xA;&#xA; I am a diligent person. I put great attention to detail."\n\t\t\t\t\t\tdateTime="Date(1371020400000)"></TimelineItem><TimelineItem userName="Sabine Mayer" select="onPressItems" title="Configuration Expert" filterValue="Configuration Expert"\n\t\t\t\t\t\tuserPicture="/images/Sabine_Mayer.png" icon="sap-icon://private"\n\t\t\t\t\t\ttext="Implementing new Public Cloud ERP Financials system into his company and keeping it aligned with business.&#xA;During the initial set-up of an ERP system: Customizing Financial Accounting settings such as organizational structures, chart of accounts, and tax configuration (as part of implementation projects).&#xA;During the ongoing maintenance of the configuration: Adapting the configuration to organizational and process changes in business. Im a versatile person. I keep the big picture in mind."\n\t\t\t\t\t\tdateTime="Date(1376290800000)"></TimelineItem><TimelineItem userName="Alain Chevalier" select="onPressItems" title="Credit Analyst" filterValue="Credit Analyst"\n\t\t\t\t\t\tuserPicture="/images/Alain_Chevalier.png" icon="sap-icon://person-placeholder"\n\t\t\t\t\t\ttext="Responsible for a high number of accounts (ca. 4000 customers).&#xA;Monitor the credit risk of his customers.&#xA;Focus on changes in his customers credit situation.&#xA;Recurring checks on a regular basis.&#xA;Decide on credit blocked sales orders.&#xA;Decide on credit limits for his customers (according the companys credit policy).&#xA;&#xA;I almost always find a pragmatic solution, thats acceptable for my customers and my company."\n\t\t\t\t\t\tdateTime="Date(1332403200000)"></TimelineItem><TimelineItem userName="Monique Legrand" select="onPressItems" title="GL Accountant" filterValue="GL Accountant"\n\t\t\t\t\t\tuserPicture="/images/Monique_Legrand.png" icon="sap-icon://private"\n\t\t\t\t\t\ttext="Ensure and adjust correct structuring of company (e.g. chart of accounts, legal/management entities , profit centers etc. ).&#xA;Ensure accuracy of financial data (profit center data).&#xA;Explain financial data for both compliance and management purposes (Profit center reporting).&#xA;Execute, check, and explain period-end close.&#xA;Identify root causes of issues on accounts, track and correct these.&#xA;&#xA;\\I am a diligent person. I put great attention to detail"\n\t\t\t\t\t\tdateTime="Date(1422777600000)"></TimelineItem><TimelineItem userName="" select="onPressItems" dateTime="Date(1167638400000)" filterValue="embedded control" icon="sap-icon://comment"><embeddedControl><m:List><m:items><m:CustomListItem><m:VBox><m:Title text="Embedded control" level="H1"/><m:Text id="additionalText" text="This text is still searchable due to the filter events."/><m:Link text="First link" press="onPress"/><m:Link text="Second link" press="onPress"/></m:VBox></m:CustomListItem></m:items></m:List></embeddedControl></TimelineItem></content></Timeline><m:TextArea id="TextArea" class="sapUiMediumMarginBeginEnd ssp-cmt" placeholder="{i18n>Addcomment}" maxlength="20" change="handleChange"\n\t\t\t\tinput="handleInput" showExceededText="true" rows="4" ariaLabelledBy="TextAreaLabel" width="95%"/><m:Button text="{i18n>send}" type="Default" press="oncomment" width="10%"\n\t\t\t\tclass="sapUiTinyMarginBegin sapUiContentPadding ssp-send swcc-pmy-btn"/></l:content></l:VerticalLayout></core:FragmentDefinition>',
